-- ----------------------------
-- Table structure for spu_info
-- ----------------------------
DROP TABLE IF EXISTS `spu_info`;
CREATE TABLE `spu_info` (
  `id` varchar(36) NOT NULL COMMENT 'spu id',
  `code` varchar(255) DEFAULT NULL COMMENT '商品编号，业务编号，用户输入',
